import {Container} from 'react-bootstrap';

class Text extends Component{
    state = {text: ""}
    getData(val){
        this.text.setState(val.target.value);
    }

    render(){
        return (
            <div className="App">
                <h1>{this.text}</h1>
                <input type="text"/>
                <button onClick={getData}>Send to pepper</button>
            </div>
        );
    }
}

export default Text;
